local assetId = {1234}
local jobId = "InsertJobIdHere"
local mode = "R6"
local baseURL = "http://localhost"
local uploadURL = "UPLOAD_URL_HERE"
local ScriptContext = game:GetService("ScriptContext")
local Lighting = game:GetService('Lighting')
local ContentProvider = game:GetService('ContentProvider')
local HttpService = game:GetService("HttpService")
local ThumbnailGenerator = game:GetService('ThumbnailGenerator')
local Players = game:GetService("Players")
local InsertService = game:GetService("InsertService")

game:GetService('StarterGui'):SetCoreGuiEnabled(Enum.CoreGuiType.All, false)
ThumbnailGenerator.GraphicsMode = 2
HttpService.HttpEnabled = true
ScriptContext.ScriptsDisabled = true
Lighting.Outlines = false

ContentProvider:SetBaseUrl(baseURL)
game:GetService("ContentProvider"):SetAssetUrl(baseURL .. "/asset/")
InsertService:SetAssetUrl(baseURL .. "/asset/?id=%d")
InsertService:SetAssetVersionUrl(baseURL .. "/asset/?assetversionid=%d")
Players:SetChatFilterUrl(baseURL .. "/Game/ChatFilter.ashx")

print("[debug] loading game...")
local loadsuccess, loaderr = pcall(function()
    game:Load('rbxasset://' .. assetId[1] .. '.rbxl')
end)

if not loadsuccess then
    warn("[error] failed to load game:", loaderr)
	HttpService.HttpEnabled = true
    local thumb, thumberr = pcall(function()
        HttpService:PostAsync(uploadURL, HttpService:JSONEncode({
            ['type'] = 'Place',
            ['assetId'] = assetId,
			['thumbnail'] = "",
			['accessKey'] = "AccessKey",
            ['jobId'] = jobId,
        }), Enum.HttpContentType.TextPlain)
    end)
    if not thumb then
        warn("[error] failed to upload fallback thumb:", thumberr)
    end
    return
end

wait(2)

print("[debug] render game")
local thumb, encoded = pcall(function()
    return ThumbnailGenerator:Click("PNG", 854, 480, false)
end)

if not thumb then
    warn("[error] failed to render thumb:", encoded)
    return
end

print("[debug] sending game thumb")
	HttpService.HttpEnabled = true
    local thumb, thumberr = pcall(function()
        HttpService:PostAsync(uploadURL, HttpService:JSONEncode({
            ['type'] = 'Place',
            ['assetId'] = assetId,
			['thumbnail'] = encoded,
			['accessKey'] = "AccessKey",
            ['jobId'] = jobId,
        }), Enum.HttpContentType.TextPlain)
    end)
	
    if not thumb then
        warn("[error] failed to upload thumb:", thumberr)
    end

print("[debug] game exit, render done")